import React, { useState } from "react";
import {Button} from "rsuite"
import LoginForm from "./loginForm";

function Login(){
    const [loginDetails, setLoginDetails] = useState()

    const loginBounds = {
        margin: "15rem auto",
        width: "15rem",
    }

    const button_styles = {
        width: "5rem",
        marginBottom: "0.5rem"
    }

    return(
        <div style={loginBounds}>
            <LoginForm setLoginDetails={setLoginDetails} button_styles={button_styles}/>
            <Button appearance="ghost">Sign-Up</Button>
            <button onClick={(e) =>{
                e.preventDefault()
                console.log(loginDetails)
            }}>Console Log</button>
        </div>
    )
}

export default Login
